import React from 'react';
import { Link } from 'react-router-dom';

function Navigation(){

    return(
        <ul style={{display: 'flex'}}>
                        <Link>
                <li>test1</li>
            </Link>
            <Link>
                <li>test1</li>
            </Link>
            <Link to="/accueil">
                <li>test2</li>
            </Link>

        </ul>
    )
}

export default Navigation
